/**
 * Counts the number of bits in the number and returns it.
 *
 * @param a Number to count bits.
 *
 * @returns The number of bits in the number.
 */
function getBitCount(a) {
    let count = 0;
    let n = a;
    while (n > 0) {
        count += n & 1;
        n >>= 1;
    }
    return count;
}
